// src/TreinoVisual.js - VERSÃO CORRIGIDA

import React, { useRef } from 'react';
import './TreinoVisual.css';

// 1. A função agora recebe as props: 'lista', 'aquecimento' e 'voltaCalma'
const TreinoVisual = ({ lista, aquecimento, voltaCalma }) => {
    const treinoRef = useRef();

    // 2. REMOVEMOS a lista de exercícios estática daqui. Ela não é mais necessária.

    // Função auxiliar para converter um arquivo (como um GIF) para Base64
    const toBase64 = file => new Promise((resolve, reject) => {
        const reader = new FileReader();
        reader.readAsDataURL(file);
        reader.onload = () => resolve(reader.result);
        reader.onerror = error => reject(error);
    });

    const handleExportHTML = async () => {
        // Validação: Não exportar se a lista estiver vazia
        if (lista.length === 0) {
            alert("Por favor, adicione pelo menos um exercício ao treino antes de exportar.");
            return;
        }

        const treinoElement = treinoRef.current;
        if (!treinoElement) return;

        const clone = treinoElement.cloneNode(true);
        const images = clone.querySelectorAll('img');

        for (const img of images) {
            const src = img.getAttribute('src');
            try {
                const response = await fetch(src);
                const blob = await response.blob();
                img.src = await toBase64(blob);
            } catch (error) {
                console.error('Erro ao embutir imagem:', src, error);
            }
        }

        const cssContent = Array.from(document.styleSheets)
            .map(sheet => {
                try {
                    return Array.from(sheet.cssRules).map(rule => rule.cssText).join('');
                } catch (e) {
                    return '';
                }
            })
            .join('');

        const htmlString = `
            <!DOCTYPE html>
            <html lang="pt-BR">
            <head>
                <meta charset="UTF-8">
                <meta name="viewport" content="width=device-width, initial-scale=1.0">
                <title>Plano de Treino</title>
                <style>${cssContent}</style>
            </head>
            <body>${clone.outerHTML}</body>
            </html>
        `;

        const blob = new Blob([htmlString], { type: 'text/html' });
        const url = URL.createObjectURL(blob);
        const a = document.createElement('a');
        a.href = url;
        a.download = 'treino-animado.html';
        document.body.appendChild(a);
        a.click();
        document.body.removeChild(a);
        URL.revokeObjectURL(url);
    };

    return (
        <div>
            <button onClick={handleExportHTML} style={{ margin: '20px', padding: '10px 15px', fontSize: '16px' }}>
                Exportar para HTML Animado
            </button>

            <div ref={treinoRef} className="container-treino">
                <header className="cabecalho-treino">
                    <div>
                        <h1>TREINO A</h1>
                        {/* 3. Usamos as props recebidas para o aquecimento */}
                        <p><strong>Aquecimento:</strong> {aquecimento || '...'}</p>
                    </div>
                    <div className="logo-area">
                        SUA <br /> LOGO <br /> AQUI
                    </div>
                </header>
                <main className="grid-exercicios">
                    {/* 4. Mapeamos a 'lista' que veio do App.js, não a lista antiga */}
                    {lista.map((ex, index) => (
                        <div key={index} className="card-exercicio">
                            <span className="numero-exercicio">{index + 1}</span>
                            {/* O objeto 'ex' tem { nome, gif }. Montamos o caminho completo. */}
                            <img src={`/gifs/${ex.gif}`} alt={ex.nome} className="gif-exercicio" />
                            <p className="nome-exercicio"><strong>{ex.nome}</strong></p>
                            {/* Adicionamos um texto padrão para série/intervalo */}
                            <p className="serie-exercicio">3x 8-12, intervalo: 45"</p>
                        </div>
                    ))}
                </main>
                <footer className="rodape-treino">
                    {/* 5. Usamos as props recebidas para a volta à calma */}
                    <p><strong>Volta à calma:</strong> {voltaCalma || '...'}</p>
                </footer>
            </div>
        </div>
    );
};

export default TreinoVisual;
